import React from "react";
import Info from "./components/info";
import Form from "./components/form";
import Shortcut from "./components/shortcut"
import Getrid from "./components/getrid"
class App extends React.Component{
  render() {
    return(
       <div>
         <Info />
         <Shortcut />
         <Getrid />
         <Form />
        </div>        
    );
  }
}

export default App;
